import React from "react";

export default function HomePage() {
  const imageLinks = [
    { src: "https://via.placeholder.com/200", url: "/page1" },
    { src: "https://via.placeholder.com/200", url: "/page2" },
    { src: "https://via.placeholder.com/200", url: "/page3" },
    { src: "https://via.placeholder.com/200", url: "/page4" },
  ];

  return (
    <div className="min-h-screen bg-gray-100 p-4">
      {/* Header */}
      <div className="flex justify-between items-center mb-8">
        <h1 className="text-4xl font-bold">My Blogs</h1>
        <div className="space-x-4">
          <button className="bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600">Login</button>
          <button className="bg-green-500 text-white px-4 py-2 rounded hover:bg-green-600">Register</button>
        </div>
      </div>

      {/* Image Links */}
      <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-4 gap-6">
        {imageLinks.map((item, index) => (
          <a href={item.url} key={index}>
            <img
              src={item.src}
              alt={`Link ${index + 1}`}
              className="w-full h-48 object-cover rounded shadow hover:scale-105 transition-transform"
            />
          </a>
        ))}
      </div>
    </div>
  );
}
